import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import VehicleOptions from './components/VehicleOptions';
import OrderForm from './components/OrderForm';
import ShoppingCart from './components/ShoppingCart';
import HomePage from './components/HomePage'; // Assurez-vous que ce fichier existe
import CataloguePage from './components/CataloguePage'; // Assurez-vous que ce fichier existe
import AppLayout from './components/AppLayout'; // Assurez-vous que ce fichier existe
import AdminDashboard from './components/AdminDashboard'; // Assurez-vous que ce fichier existe

function App() {
  return (
    <Router>
      <div>
        {/* Utilisez React Router pour afficher les composants en fonction de la route */}
        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/vehicle-options" element={<VehicleOptions />} />
          <Route path="/order" element={<OrderForm />} />
          <Route path="/cart" element={<ShoppingCart />} />
          <Route path="/catalogue" element={<CataloguePage />} />
          <Route path="/admin-dashboard" element={<AdminDashboard />} />
          {/* Route avec mise en page commune (ex: AppLayout) */}
          <Route path="/app-layout" element={<AppLayout />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
